package com.amandris.clients.web.view;import org.apache.struts.action.ActionForm;public class AlbumElementView extends ActionForm{	private String 	id;	private String 	sellerId;	private String 	mediaTypeConst;	private String	code;	private String	text;	private String 	views;	private String 	votes;	private String 	active;		private static final long serialVersionUID = 321506774680931L;	public String getActive() {		return active;	}	public void setActive(String active) {		this.active = active;	}	public String getCode() {		return code;	}	public void setCode(String code) {		this.code = code;	}	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getMediaTypeConst() {		return mediaTypeConst;	}	public void setMediaTypeConst(String mediaTypeConst) {		this.mediaTypeConst = mediaTypeConst;	}	public String getSellerId() {		return sellerId;	}	public void setSellerId(String sellerId) {		this.sellerId = sellerId;	}	public String getText() {		return text;	}	public void setText(String text) {		this.text = text;	}	public String getViews() {		return views;	}	public void setViews(String views) {		this.views = views;	}	public String getVotes() {		return votes;	}	public void setVotes(String votes) {		this.votes = votes;	}		}